import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonItem, IonLabel } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab2.css';

const Tab2: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Iniciar Captura de Coordenadas</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Coordenadas</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonItem>
          <IonLabel>Celular</IonLabel>
          <IonInput value={getStorage('cellphone')} placeholder="Numero de Celular" onIonChange={e => setStorage(e.detail.value!,'cellphone')}></IonInput>          
        </IonItem>
      </IonContent>
    </IonPage>
  );
};

export default Tab2;
